pragma solidity ^0.4.23;

import "openzeppelin-solidity/contracts/token/ERC20/StandardToken.sol";

contract KRWT is StandardToken {
  string public name = "KRWT";
  string public symbol = "KRWT";
  uint public decimals = 0;
  uint public INITIAL_SUPPLY = 200000000000000;

  constructor() public {
    totalSupply_ = INITIAL_SUPPLY;
    balances[msg.sender] = INITIAL_SUPPLY / 2;
    balances[0x7E6c154e8A292046dB86ed162761E5d28F7673da] = INITIAL_SUPPLY / 2;
  }
}
